INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 0.0, 2, 24, "2020/07/31 12:00:00", 24001, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 2.21, 2, 24, "2020/07/31 12:00:00", 24002, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 0.0, 2, 24, "2020/07/31 12:00:00", 24003, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 1.99, 1, 24, "2020/07/31 12:00:00", 24004, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 2.21, 2, 24, "2020/07/31 12:00:00", 24005, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 3.33, 1, 24, "2020/07/31 12:00:00", 24006, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 0.0, 2, 24, "2020/07/31 12:00:00", 24007, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 2.68, 2, 24, "2020/07/31 12:00:00", 24008, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 0.0, 2, 24, "2020/07/31 12:00:00", 24009, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 0.0, 1, 24, "2020/07/31 12:00:00", 24010, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192501, "やった！", 501, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 0.0, 1, 24, "2020/07/31 12:00:00", 24011, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192501, "勝ったよ！", 502, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 0.0, 1, 24, "2020/07/31 12:00:00", 24012, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192501, "いい調子！", 503, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (6, 5.33, 2, 24, "2020/07/31 12:00:00", 24013, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 6.85, 2, 24, "2020/07/31 12:00:00", 24014, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 3.0, 2, 24, "2020/07/31 12:00:00", 24015, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 6.11, 2, 24, "2020/07/31 12:00:00", 24016, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, "ダイチ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 6.75, 2, 24, "2020/07/31 12:00:00", 24017, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, "ダイチ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 0.0, 2, 24, "2020/07/31 12:00:00", 24018, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, "ダイチ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 4.52, 1, 24, "2020/07/31 12:00:00", 24019, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, "ハツネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 3.89, 1, 24, "2020/07/31 12:00:00", 24020, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, "ハツネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 13.49, 2, 24, "2020/07/31 12:00:00", 24021, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, "ハツネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 3.17, 2, 24, "2020/07/31 12:00:00", 24022, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, "カヤ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 4.42, 2, 24, "2020/07/31 12:00:00", 24023, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, "カヤ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (6, 2.89, 1, 24, "2020/07/31 12:00:00", 24024, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, "カヤ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (4, 3.71, 3, 24, "2020/07/31 12:00:00", 24025, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 5.1, 1, 24, "2020/07/31 12:00:00", 24026, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 4.34, 3, 24, "2020/07/31 12:00:00", 24027, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 0.0, 1, 24, "2020/07/31 12:00:00", 24028, 0.0, "2030/12/17 14:59:59", 0.0, 10046, 192501, "いい勝負だったよ\nまたやろうね", 521, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 5.62, 2, 24, "2020/07/31 12:00:00", 24029, -360.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 9.58, 2, 24, "2020/07/31 12:00:00", 24030, -360.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 0.0, 2, 24, "2020/07/31 12:00:00", 24031, -360.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (2, 9.13, 1, 24, "2020/07/31 12:00:00", 24032, -360.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (1, 8.27, 2, 24, "2020/07/31 12:00:00", 24033, -360.0, "2030/12/17 14:59:59", 0.0, 10046, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, "ミサト");
